import React from 'react'
import 'p5'
import p5 from "p5";
import Data from './output'

class Galaxy extends React.Component {
  constructor(props) {
    super(props);
    this.sketchRef = React.createRef()
    this.state = {
      sketch: undefined,
      dots: {}
    }
    console.log("WHAAAT")
    console.log(Data)
  }

  circles = (sketch) => {
    var col;
    this.state.sketch = sketch;
    sketch.setup = () => {
      sketch.createCanvas(window.innerWidth, window.innerHeight);
      sketch.background(0);
      sketch.fullscreen();
    }

    sketch.draw = () => {
      sketch.strokeWeight(1);
      let arr = Data[Date.now() % 3.14]
      stroke('white')
      for (let i=0; i < arr.length; i++) {
          sketch.point(arr[i][0], arr[i][1])
      }
    }
  }

  render() {
      return(<div></div>)
    }

}

export default Galaxy;
